const Form = () =>{
    return (

        <form className="Log-in">
            <div>
            <label htmlFor="email">Enter Email:</label>
            <input type="text" id="email"/>
            </div>
            <div>
            <label htmlFor="password">Enter Password</label>
            <input type="password" id = "password"/>
            </div>
            <div>
            <button type="submit">Log In</button>
            </div>

        </form>

    );
};

export default Form;
